import React, { useState } from "react";
import { Button } from "@mui/material";
import styles from "./Projects.module.scss";
import IconButton from "@mui/material/IconButton";
import MenuItem from "@mui/material/MenuItem";
import Menu from "@mui/material/Menu";
import Login from "../login/Login.js";


const ActionsDropdown = () => {
    const [anchorEl, setAnchorEl] = useState(null);
  
    const handleClick = (event) => {
      setAnchorEl(event.currentTarget);
    };
  
    const handleClose = () => {
      setAnchorEl(null);
    };
  
    return (
      <div>
        <IconButton
          aria-label="dropdown"
          aria-controls="dropdown-menu"
          aria-haspopup="true"
          onClick={handleClick}
        >
          {/* Icon Here */}
        </IconButton>
        <Menu
          id="dropdown-menu"
          anchorEl={anchorEl}
          open={Boolean(anchorEl)}
          onClose={handleClose}
        >
          <MenuItem onClick={() => {}}>Overview/Edit</MenuItem>
          <MenuItem onClick={() => {}}>Duplicate</MenuItem>
          <MenuItem onClick={() => {}}>Unpin</MenuItem>
          <MenuItem onClick={() => {}}>Rename</MenuItem>
          <MenuItem onClick={() => {}}>Delete</MenuItem>
        </Menu>
      </div>
    );
  };

  const ProjectItem = ({ city, name, creationDate, ...props }) => {
    const getBackgroundImage = () => {
      if (city === "gothenburg") {
        return 'url("/city-images/gothenburg.png")';
      } else if (city === "vienna") {
        return 'url("/city-images/vienna.png")';
      } else if (city === "rennes") {
        return 'url("/city-images/rennes.png")';
      }
      return "";
    };
  
    return (
      <div
        style={{
          width: "300px",
          height: "250px",
          border: "1px solid gray",
          boxShadow: "1px 1px 5px gray",
          borderRadius: "2px"
        }}
      >
        <div
          style={{
            backgroundImage: getBackgroundImage(),
            backgroundSize: "cover",
            backgroundRepeat: "no-repeat",
            backgroundPosition: "center",
            height: "70%"
          }}
        ></div>
        <div
          style={{
            height: "30%",
            display: "flex",
            alignItems: "center",
            padding: "0px 15px",
            borderTop: "2px solid gray"
          }}
        >
          <div style={{ flexGrow: "1" }}>
            <strong style={{ fontSize: "18px" }}>{name}</strong>
            <div>Created in {creationDate}</div>
          </div>
          <ActionsDropdown />
        </div>
      </div>
    );
  };

  
function Projects() {
    return (
        <div className={styles.container}>
            <div className={styles.projectsContainer}>
                <ProjectItem city="gothenburg" name="Gothenburg Project" creationDate="2021-09-15" />
                <ProjectItem city="vienna" name="Vienna Project" creationDate="2021-09-15" />
                <ProjectItem city="rennes" name="Rennes Project" creationDate="2021-09-15" />
            </div>
        </div>
    );
}
